                      />
                  ))
                  : dummyProjectsArr.map((project, index) => (
                      <ProjectCard
                          key={`dummy-${0}`}
                          id={`dummy-${0}`}
                          value={project}
                      />
                  ))}
            </Row>
          </Container>
        </Jumbotron>
        );
      </div>
    </div>
  );
};

export default Leadership;
